import React from 'react';
import '../Css/ResultCard.css';

export const ResultCard = ({anime}) => {
    return (
        <section className="result-card-list">
            <article className="result-card">
                <header className="result-card-header">
                    <img alt="Hunter x Hunter (2011)"
                        src="https://cdn.myanimelist.net/images/anime/11/33657.jpg?s=5724d8c22ae7a1dad72d8f4229ef803f"
                    />
                    <h4>Hunter x Hunter (2011)</h4>
                </header>
            </article>
        </section>
    )
}
